    public List<Tuple<int, int?, String>> GetRootMenuList()
    {
        return informationList.FindAll(x => x.Item2 == null);
    }

    public List<Tuple<int, int?, String>> GetDetailMenuItemList(int rootItemId)
    {
        return informationList.FindAll(x => x.Item2.HasValue && x.Item2.Value == rootItemId);
    }

    private void SetInformationDetailId(int id, int? parentId)
    {
        if (!parentId.HasValue)
        {
            if (selectedCatId == id)
            {
                selectedCatId = null;
            }
            else
            {
                selectedCatId = id;
            }
        }
        else
        {
            selectedItemId = id;
        }
    }

    private InformationDetailObject GetInformationDetail()
    {
        return InformationDetailList.Find(x => x.id == selectedItemId);
    }

